const GlobalClasses = () => {
  return (
    <style jsx global>
      {`
        // CONTAINER
        .container {
          width: 96vw;
          max-width: ${container};
        }

        // MAIN
        main {
          padding: 100px 50px;
        }
        .no-main-padding main {
          margin-top: 100px;
        }

        // FLEXBOX
        .d-flex {
          display: flex;
        }
        .justify-center {
          justify-content: center;
        }
        .space-between {
          justify-content: space-between;
        }
        .space-around {
          justify-content: space-around;
        }
        .align-center {
          align-items: center;
        }
        .flex-column {
          flex-direction: column;
        }
        .flex-wrap {
          flex-wrap: wrap;
        }
      `}
    </style>
  );
};

export default GlobalClasses;
